    drawFlagLine("#flagred1", 50, Math.random() * max_timeout);
    drawFlagLine("#flagred2", 100, Math.random() * max_timeout);
    drawFlagLine("#flagred3", 100, Math.random() * max_timeout);
    drawFlagLine("#flagred4", 300, Math.random() * 200);
